func Test_AmmPrelaunch(t *testing.T) {
	var (
		interfaces []*abi.InterfaceDesc
		i          *abi.InterfaceDesc
	)

	j, err := os.ReadFile("storm_prelaunch.json")
	require.Nil(t, err)

	err = json.Unmarshal(j, &interfaces)
	require.Nil(t, err)

	for _, i = range interfaces {
		if i.Name == "amm_prelaunch" {
			err := abi.RegisterDefinitions(i.Definitions)
			require.Nil(t, err)
			break
		}
	}

	var getMethodTestCases = []*struct {
		name           string
		boc            string
		code           string
		data           string
		addr           string
		expected       string
		methods        []string
		expectedMethod []any
	}{
		{
			addr:    "EQAfWFIBG70-V6DyI2anpeai4c_xUaXcqtMaTOd3vqhTttrb",
			code:    "",
			data:    "",
			methods: []string{"get_amm_contract_data", "get_prelaunch_asset"},
		},
	}

	for _, test := range getMethodTestCases {
		for _, method := range test.methods {
			ret := execGetMethod(t, i, address.MustParseAddr(test.addr), method, test.code, test.data)

			spew.Dump(ret[0])
		}
	}

	var messageTestCases = []*struct {
		messageB64 string
		name       string
	}{
		{
			messageB64: "",
			name:       "amm_prelaunch::init",
		},
	}

	for _, test := range messageTestCases {
		boc, err := hex.DecodeString(test.messageB64)
		require.Nil(t, err)

		j := loadOperation(t, i, test.name, base64.StdEncoding.EncodeToString(boc))

		spew.Dump(j)
	}
}

