func Test_PositionManager(t *testing.T) {
	var (
		interfaces []*abi.InterfaceDesc
		i          *abi.InterfaceDesc
	)

	j, err := os.ReadFile("storm.json")
	require.Nil(t, err)

	err = json.Unmarshal(j, &interfaces)
	require.Nil(t, err)

	for _, i = range interfaces {
		if i.Name == "position_manager_v2r1" {
			err := abi.RegisterDefinitions(i.Definitions)
			require.Nil(t, err)
			break
		}
	}

	data := "te6cckEBBAEArgACy4AR/pMfGKpMVdar760phlsubqo6DFkLUeuH/uBQKdaZn7ADynReiCeK8xlKRbYArpp4jyzZuF6+tYfhFM0O5ulOs5IAFuMs7hM3WflHsoioambsKG+Isos9iGFChE88qYrjjanX/AECAQMf6AMAEQAAAAAAAAAAIABjAAAAAAAAAAAAAAAABfQubSBqsI/aBqsI/YAAAAACWm2DgAknwAAAAAAAAAAAMsO8t0AABn+o"
	boc, err := base64.StdEncoding.DecodeString(data)
	require.Nil(t, err)

	c, err := cell.FromBOC(boc)
	require.Nil(t, err)

	method := getMethodDescByName(i, "get_position_manager_contract_data")

	v, err := method.ReturnValues[0].Fields.FromCell(c)
	require.Nil(t, err)

	spew.Dump(v)
}

